#include <iostream>

template<class T, class U> class pair {
    public:
    T first;
    U second;
    bool operator < (const pair<T, U> b) const {
        if(this->first == b.first) {
            return this->second < b.second;
        }
        return this->first < b.first;
    }
};

void swap(pair<int, int> &a, pair<int, int> &b) {
    pair<int, int> tmp = a;
    a = b;
    b = tmp;
}

template<class T> class vector {
    T* arr;
    int sz;
    int cap;
public:
    vector() {
        sz = 0;
        cap = 1;
        arr = new T[cap];
    }
    void push_back(T x) {
        if (sz == cap) {
            T* tmp = new T[2 * cap];
            for (int i = 0; i < sz; i++) {
                tmp[i] = arr[i];
            }
            delete[] arr;
            arr = tmp;
            cap *= 2;
        }
        arr[sz++] = x;
    }
    void pop_back() {
        sz--;
    }
    int size() {
        return sz;
    }
    T& operator[](int i) {
        return arr[i];
    }
};

template<class T> class priority_queue {
    vector<T> heap;
    int size;
    bool cmp(T a, T b) {
        return b < a;
    }
    void heapify(int i) {
        int l = 2 * i + 1;
        int r = 2 * i + 2;
        int largest = i;
        if(l < size && cmp(heap[l], heap[i])) {
            largest = l;
        }
        if(r < size && cmp(heap[r], heap[largest])) {
            largest = r;
        }
        if(largest != i) {
            swap(heap[i], heap[largest]);
            heapify(largest);
        }
    }
public:
    priority_queue() {
        size = 0;
    }

    void push(T x) {
        heap.push_back(x);
        int i = size;
        size++;
        while (i > 0 && cmp(heap[i], heap[(i - 1) / 2])) {
            swap(heap[i], heap[(i - 1) / 2]);
            i = (i - 1) / 2;
        }
    }
    T top() {
        return heap[0];
    }
    void pop() {
        swap(heap[0], heap[size - 1]);
        size--;
        heap.pop_back();
        heapify(0);
    }
    int get_size() {
        return size;
    }
    void remove(int cadastro) {
        int ind = -1;
        for(int i = 0; i < size; i++) {
            if(heap[i].second == cadastro and ind == -1) {
                ind = i;
            }
        }
        swap(heap[ind], heap[size - 1]);
        size--;
        heap.pop_back();
        heapify(ind);
    }    
};

int main() {
    freopen("in.txt", "r", stdin);
    freopen("out.txt", "w", stdout);
    int f, q;
    std::cin >> f >> q;
    priority_queue<pair<int, int>> fileiras[f + 1], sem_assento;
    int n;
    std::cin >> n;
    std::string nomes[n + 1];
    int prioridades[n + 1], lugar[n + 1];
    int cadastro_atual = 1;
    for(int _ = 0; _ < n; _++) {
        std::string type;
        std::cin >> type;
        if(type == "CAD") {
            std::string nome;
            int p;
            std::cin >> nome >> p;
            nomes[cadastro_atual] = nome;
            prioridades[cadastro_atual] = p;
            bool cadastrado = false;
            int fileira = -1;
            for(int i = 1; i <= f; i++) {
                if(fileiras[i].get_size() < q and !cadastrado) {
                    fileiras[i].push({-p, cadastro_atual});
                    fileira = i;
                    lugar[cadastro_atual] = i;
                    cadastrado = true;
                }
            }
            if(!cadastrado) {
                pair<int, int> mn = {INT_MAX, INT_MAX};
                int posicao = -1;
                for(int i = 1; i <= f; i++) {
                    pair<int, int> tmp = fileiras[i].top();
                    tmp.first = -tmp.first;
                    if(tmp.first < mn.first) {
                        mn = tmp;
                        posicao = i;
                    } else if(tmp.first == mn.first and tmp.second > mn.second) {
                        mn = tmp;
                        posicao = i;
                    }
                }
                bool inserir = true;
                if(p < mn.first) {
                    inserir = false;
                } else if(p == mn.first and cadastro_atual > mn.second) {
                    inserir = false;
                }
                if(inserir) {
                    cadastrado = true;
                    fileira = posicao;
                    sem_assento.push({mn.first, -mn.second});
                    lugar[mn.second] = 0;
                    fileiras[posicao].pop();
                    fileiras[posicao].push({-p, cadastro_atual});
                    lugar[cadastro_atual] = posicao;
                }
            }
            if(!cadastrado) {
                sem_assento.push({p, -cadastro_atual});
            }
            if(cadastrado) {
                std::cout << nome << " (" << cadastro_atual << ") foi alocado(a) na fileira " << fileira << "\n";
            } else {
                std::cout << nome << " (" << cadastro_atual << ") nao foi alocado(a) em nenhuma fileira\n";
            }
            cadastro_atual++;
        } else if(type == "REM") {
            std::string nome;
            int cad;
            std::cin >> nome >> cad;
            if(cad > n or nomes[cad] != nome or lugar[cad] == -1) {
                std::cout << "Inexistente\n";
            } else {
                if(lugar[cad] == 0) {
                    sem_assento.remove(cad);
                } else {
                    fileiras[lugar[cad]].remove(cad);
                    if(sem_assento.get_size()) {
                        pair<int, int> tmp = sem_assento.top();
                        sem_assento.pop();
                        fileiras[lugar[cad]].push({tmp.first, -tmp.second});
                        lugar[-tmp.second] = lugar[cad];
                    }
                }
                lugar[cad] = -1;
            }
        } else if(type == "VER") {
            std::string nome;
            int cad;
            std::cin >> nome >> cad;
            if(cad > n or nomes[cad] != nome or lugar[cad] == -1) {
                std::cout << "Inexistente\n";
            } else {
                if(lugar[cad] == 0) {
                    std::cout << "Sem assento\n";
                } else {
                    std::cout << "Sentado(a) na fileira " << lugar[cad] << "\n";
                }
            }
        }
    }
    return 0;
}

