#include <iostream>

using namespace std;

void Print(int* arr, int size) {
	for (int i = 0; i < size; i++) {
		cout << arr[i] << " ";
	}
	cout << endl;
}

void Fill(int* arr, int size) {
	for (int i = 0; i < size; i++) {
		arr[i] = rand() % 10;
	}
}

bool IsSimple(int number) {
	for (int i = 2; i < number; i++) {
		if (number % i == 0) {
			return false;
		}
	}
	return true;
}

int main() {
	// удаление из массива все простые числа
	srand(time(NULL));
	setlocale(LC_ALL, "ru");

	int size;
	cout << "Введите размер массива: ";
	cin >> size;

	int* arr = new int[size];

	Fill(arr, size);
	Print(arr, size);

	int count = 0;
	for (int i = 0; i < size; i++) {
		if (!IsSimple(arr[i])) {
			count++;
		}
	}

	int* result = new int[count];

	count = 0;
	for (int i = 0; i < size; i++) {
		if (!IsSimple(arr[i])) {
			result[count] = arr[i];
			count++;
		}
	}

	delete[] arr;
	arr = result;
	size = count;

	Print(arr, size);

	delete[] result;
}
